import React from 'react'
import ReactDOM from 'react-dom'

const fname = 'Shyam'
const lname = 'Rajput'
console.log(`hello ${fname}`)
ReactDOM.render(
  <>
    <h1>My Name is {fname + ' ' + lname}</h1>
    <p>Here the list of series {3 + 7}</p>
    <p>Plz like and share{Math.random()}</p>
    <ol>
      <li>First</li>
      <li>Second</li>
      <li>Third</li>
      <li>Fourth</li>
      <li>Fifth</li>
    </ol>
  </>,
  document.getElementById('root')
)

